import ProductsSlider from "./ProductsSlider";
export default class Products extends React.Component{

    render(){

        return(
            <React.Fragment>
                <div className="products container-fluid">
                    <div className="row">
                        <ProductsSlider products={this.props.productsPromo}></ProductsSlider>
                        <ProductsSlider products={this.props.productsRowFirst}></ProductsSlider>
                        <ProductsSlider products={this.props.productsRowSecond}></ProductsSlider>
                        <ProductsSlider products={this.props.productsRowThird}></ProductsSlider>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
